# Cross-cluster functionalities
class CrossClusterFeatures:
    def derive_office_names(self, office_codes: List[str]) -> Dict[str, str]:
        """Derive office names from codes."""
        return {code: f"Office_{code}" for code in office_codes}

    def update_sample_file_link(self, correct_file: str) -> bool:
        """Update sample file link to point to correct file."""
        return correct_file.endswith(".csv")

    def handle_partial_zip(self, zip_code: str) -> bool:
        """Handle ZIP codes missing last 4 digits."""
        return len(zip_code) == 5 and zip_code.isdigit()

    def update_status_labels(self, submissions: List[Dict]) -> List[Dict]:
        """Update status labels for Submission Dashboard."""
        for sub in submissions:
            sub["status"] = "Processed" if sub.get("processed") else "Pending"
        return submissions
